import React from 'react';
import Moment from 'mo'

class  Calendar extends React.Component {

render (){ 
    return(

<div className="calendar-container">

<h2>Calendar</h2>
<Moment format="YYYY/MM/DD">{this.props.dateToFormat}</Moment>

</div>
    

    




    );
}
}
 export default Calendar;
